import React from 'react'
import './home.css'
import AppointmentCard from './AppointmentCard';
 
import img1 from '../../../assets/p5.jpeg';
import img2 from '../../../assets/p1.png';
import img3 from '../../../assets/p3.png';
import img4 from '../../../assets/p2.png';
function Home() {
    return (
        <div className="home_page">
            <h2>NURSING MANAGEMENT SYSTEM</h2>
            
            <div className='card-group-1'>
            <AppointmentCard imgURL={img1}  title='Place Ordersss' text={"Don't be late\nPlace a Order\nWhat you want"} URLpath={"/addOrder"}/>
            <AppointmentCard   imgURL={img2}  title='Our Products' text={"Once You've Opened it,\nYou've Opened up\nyour mind"} URLpath={"/cus"}/>
            <AppointmentCard imgURL={img3}  title='Branch Details' text={"Medicines cure diseases,\nbut only Doctors can\ncure Patients"} />
            <AppointmentCard imgURL={img4} title='Delivery Details' text={"Medicines cure diseases,\nbut only Doctors can\ncure Patients"} />
            </div>
        </div>
    )
}

export default Home
